import { AppGlobalState } from 'src/app/store/a.state';
import { AppState } from 'src/app/store/app.state';
import { WishlistState } from 'src/app/store/w.state';
import { ListBuilder } from './list-builder';
import { randomString } from './utils';

export const appStateStub = (): AppStateBuilder => new AppStateBuilder();

export class AppStateBuilder implements AppState {
  ag: AppGlobalState = {
    loading: false,
  };
  wishlist: WishlistState = {
    categories: [],
    items: [],
  };

  public static someCategories(): AppStateBuilder {
    const b = new AppStateBuilder();
    b.wishlist.categories = ListBuilder.with((i) =>
      randomString(8, 'Category ')
    )
      .items(7)
      .build();
    return b;
  }
}

export class ListBuilder<T> {
  private count = 1;

  static with<T>(generator: (index: number) => T): ListBuilder<T> {
    return new ListBuilder(generator);
  }

  constructor(private generator: (index: number) => T) { }

  public items(count: number): ListBuilder<T> {
    this.count = count;
    return this;
  }

  public build(): T[] {
    const r = [];
    for (let i = 0; i < this.count; i++) {
      r.push(this.generator(i));
    }

    return r;
  }
}

export class Result<T> {
  constructor(public readonly data: T, public readonly success = true) {}
}

import { WishlistItem } from 'src/app/business/item';
import { randomNumber, randomString } from './utils';

export class WishlistItemBuilder {
  id = randomNumber(900);
  title = randomString(8, 'title ');
  description = randomString(30, 'description ');
  image_url = randomString(8, 'image ');
  shopping_url = randomString(8, 'shop ');
  category = randomString(8, 'category ');

  static n() {
    return new WishlistItemBuilder();
  }

  static default() {
    return WishlistItemBuilder.n().build();
  }

  withCategory(category: string) {
    this.category = category;
    return this;
  }

  build(): WishlistItem {
    return {
      id: this.id,
      Title: this.title,
      Description: this.description,
      ImgageUrl: this.image_url,
      BuyUrl: this.shopping_url,
      Category: this.category,
    };
  }
}

